'use strict';var parseErrorStack=require('../parseErrorStack');function getFakeError(){return new Error('Happy Cat');}describe('parseErrorStack',function(){it('parses error stack',function(){var stack=parseErrorStack(getFakeError().stack);expect(stack.length).toBeGreaterThan(0);var firstFrame=stack[0];expect(firstFrame.methodName).toEqual('getFakeError');expect(firstFrame.file).toMatch(/parseErrorStack-test\.js$/);});it('does not support framesToPop',function(){function getWrappedError(){var error=getFakeError();error.framesToPop=1;return error;}var stack=parseErrorStack(getWrappedError().stack);expect(stack[0].methodName).toEqual('getFakeError');});it('ignores bad inputs',function(){expect(parseErrorStack(undefined)).toEqual([]);expect(parseErrorStack(null)).toEqual([]);});});